import BlogPreview from '../components/BlogPreview';
import { useEffect, useState } from 'react';
const Home = () => {
  const [posts, setPosts] = useState();

  useEffect(async () => {
    const result = await fetch('http://locahost:1337/posts');
    setPosts(result.data);
  });
  console.log(posts);
  return (
    <div className='home'>
      <div className='top-rated grid grid-cols-1 gap-8 justify-items-center'>
        <h1 className='text-4xl my-12 '>Top Rated Blogs</h1>
        <BlogPreview />
        <BlogPreview />
        <BlogPreview />
      </div>
      <div className='top-rated grid grid-cols-1 gap-8 justify-items-center'>
        <h1 className='text-4xl my-12 '> Blogs About Health</h1>
        <BlogPreview />
        <BlogPreview />
        <BlogPreview />
      </div>
      <div className='top-rated grid grid-cols-1 gap-8 justify-items-center'>
        <h1 className='text-4xl my-12 '>Blogs About Wealth</h1>
        <BlogPreview />
        <BlogPreview />
        <BlogPreview />
      </div>
      <div className='top-rated grid grid-cols-1 gap-8 justify-items-center'>
        <h1 className='text-4xl my-12 '>Blogs About Wisdom</h1>
        <BlogPreview />
        <BlogPreview />
        <BlogPreview />
      </div>
    </div>
  );
};

export default Home;
